(869, 4, 'entrada', '557133706350', 'texto', 'Olá ALZIRA MARIA SANTOS CORDEIRO DOS SANTOS!\n\nNotamos que a sua conta de energia com vencimento em 01/12/2025 no valor R$ 136.13 ainda está em aberto.\n\nSabemos que imprevistos acontecem e por isso estamos aqui para te ajudar. Responda essa mensagem e escolha as opções para 2a via ou negociação de dívidas.', 'false_557133706350@c.us_53AA5770C842262D80', 'recebido', NULL, '2025-12-30 20:05:43', '2025-12-30 20:05:43'),
(870, 4, 'entrada', '557133706350', 'texto', 'Olá! Eu sou a assistente virtual da Neoenergia Coelba.\n \nPara começar, escolha o serviço para o qual deseja atendimento.\n \n*Novidade!* Agora você também pode pedir a *segunda via* da sua conta por *mensagens de voz*, *basta nos mandar um áudio* 💬', 'false_557133706350@c.us_5197CD017C851DA32E', 'recebido', NULL, '2025-12-30 20:07:31', '2025-12-30 20:07:31'),
