(2177, NULL, 'entrada', '120363153211725317', 'texto', 'Depende do nicho. Desenvolvi um produto digital 100% automatizado com agentes no n8n. Do tráfego a emissão de nota....\n\nTentei duas estratégias.\n\n1.Campanha só para construir audiência. Lead a 0.033... Muitas curtidas, comentários, seguidores e etc. Vendia? Vendia... Mas...\n\n2.Fiz uma campanha de vendas direto para o Whatsapp. Leads 40x mais caro, porem muito mais vendas, 0 curtidas, 0 comentários e etc...Nem atualizei mais perfil, site e etc, abandonei tudo.\n\nDaí fui melhorando a estratégia 2. Implementei no agente de fechamento a CAPI, nisso melhorou bastante as vendas.\n\nComo tudo é registrado no banco de dados, tudo isso foi construindo uma lista de clientes ultrasegmentada. Daí hoje eu crie uma lookalike de mais de 1.000 leads.\n\nVamos ver se ainda melhora mais...\n\n\nResumindo, não quero mais saber de audiência e etc. Pelo menos para mim foi perda de tempo', 'false_120363153211725317@g.us_ACD0DC1B3D151B1B6B426F1DCFCE2605_196722538094652@lid', 'recebido', NULL, '2026-01-06 00:38:04', '2026-01-06 00:38:04'),
