(2179, NULL, 'entrada', '120363049065419885', 'texto', 'Pode se fazer tudo nessa vida, já as punições se for pega precisa averiguar na lei. Pessoalmente não vejo porque um MEI não emitir nota. Em algum momento você vai querer ou precisar realizar valores recebidos na PJ para a PF, sendo que você nem paga imposto algum para emitir... daqui a pouco vai juntar uma quantia e querer adquirir um bem na pessoa física, e não vai ter lastro nenhum', 'false_120363049065419885@g.us_3EB066AC70870FEE8E51F5_50680832200951@lid', 'recebido', NULL, '2026-01-06 00:44:30', '2026-01-06 00:44:30'),
