(2225, NULL, 'entrada', '120363049065419885', 'texto', 'As pessoas vão julgar você e suas propostas pelo o que acham que você ganha normalmente. E tem empresas/pessoas que vão procurar as agências grandes, tem quem vai procurar as médias, quem vai procurar as pequenas, quem vai procurar o MEI e quem vai procurar o \"sobrinho\". Com base em experiência própria no nosso nicho, eu acredito que você almeje ao menos o que seria o faturamento de microempresa, mas na lida com o cliente não se posiciona nem como MEI, sendo que já tem muita gente na faixa do \"sobrinho\" ao MEI e cobrando pouco ao mesmo tempo que entrega pouco e que dura pouco no mercado.', 'false_120363049065419885@g.us_3EB029529EE84A6D845CF3_50680832200951@lid', 'recebido', NULL, '2026-01-06 11:36:36', '2026-01-06 11:36:36'),
