(2228, NULL, 'entrada', '120363405505672490', 'texto', '🟡 _A Jornada Python está chegando..._ \n\n🤩 Faltam _poucos dias_ para começar o Curso Gratuito do Python *(12/Janeiro)* e eu queria passar aqui pra tirar mais algumas *dúvidas*: \n\n1️⃣ \"Vou ganhar _Certificado de Participação_\"?\nTeremos *Certificado* para todos que participarem e *vierem ao vivo para as aulas*! Vou dar _mais detalhes na 1ª aula_.\n\n2️⃣ \"Não sei absolutamente nada de Programação ou de Python _vou conseguir acompanhar_?\"\nCom certeza! Tudo foi pensado para QUALQUER UM conseguir acompanhar.\n\n3️⃣ \"Qual _horário_ das aulas?\"\n*19h30min* e devem durar cerca de 2h cada.\n\n4️⃣ \"E se eu não conseguir estar ao vivo? Vai ficar _gravado_?\"\nNão, a ideia é liberar _apenas ao vivo_. O que a gente pretende fazer é deixar cada aula liberada por algumas horas após terminada para vocês poderem treinar.\n\n✨ E lembre-se: Confie apenas nos administradores desse grupo e leia sempre a descrição do grupo. \n\n📩 Se tiver _qualquer outra dúvida_, é só enviar um email para listavip@hashtagtreinamentos.com, que vai vir alguém correndo da minha equipe responder!\n\n👊🏻 Até semana que vem!\n\nObs: Caso o link não fique clicável, basta reagir essa mensagem com um \"👍\".', 'false_120363405505672490@g.us_3EB05F8AE073EC1212239BB5AF6D2404CA1A09E1_149332271591631@lid', 'recebido', NULL, '2026-01-06 12:11:07', '2026-01-06 12:11:07'),
