(2371, NULL, 'entrada', '55719178077214530547', 'texto', '🏡 *ITAPUÃ* \nVILLAGE 2/4 EM ITAPUÃ com 97m²\n\nValor R$ 520.000\n\nCondomínio R$ 660 / mês\n\nIPTU R$ 770\n\nVILLAGE EM TAPUÃ, SALVADOR\n\nCONDOMÍNIO PRATICAMENTE PÉ NA AREIA!\n\nDuplex charmoso de 2/4 (climatizados)01 com varanda, varanda na entrada, 01 banheiro social no andar superior e 01 lavabo no térreo, sala de estar, cozinha ventilada, área de serviço e uma área gourmet no fundo da residência. Teto inferior em gesso decorado e iluminado, teto superior em madeira de lei\n\nVaga de garagem coberta e privilegiada. \n\nSEMI MOBILIADO, inclusive Refrigerador side by side LG\n\nCondomínio possui:\n- 01 Piscina;\n- Quiosque para festas;\n- Portaria 24 horas;\n\nFica à 03 minutos (andando) para a praia, muito bem localizado e\nrua sossegada. Imóvel todo regularizado, escriturado, podendo financiar para qualquer banco.\n\nCondomínio: R$ 660,00 / mês;\n\nREF:1023jos', 'false_557191780772-1453054742@g.us_AC9CE0CBF3CA8798D69A22BE975E7F82_131056648851558@lid', 'recebido', NULL, '2026-01-06 18:56:35', '2026-01-06 18:56:35'),
