(2373, NULL, 'entrada', '55719178077214530547', 'texto', '🏙 Acupe Exclusive – Brotas\n💰 R$ 460.000\n📍 Brotas – Salvador/BA\n\nCondomínio: R$ 650/mês\nIPTU: R$ 800 anual \n\n✨ Descrição do Imóvel\nLindo apartamento 2/4 com suíte, localizado no desejado Acupe Exclusive, em Brotas. Unidade pronta para morar, com armários planejados em todos os cômodos, proporcionando praticidade e excelente aproveitamento de espaço.\n\n🏢 Condomínio de torre única, garantindo mais privacidade e tranquilidade, além de oferecer infraestrutura completa, ideal para quem busca conforto, lazer e segurança.', 'false_557191780772-1453054742@g.us_ACF1D7B1121F6AA0D3679D33203F7903_131056648851558@lid', 'recebido', NULL, '2026-01-06 18:56:36', '2026-01-06 18:56:36'),
