(2381, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *São Judas* Apartamento 3 Dormitórios – Varanda Gourmet – Próximo ao Metrô São Judas\n\nApartamento moderno e impecável, localizado entre os metrôs Conceição (400 m) e São Judas (500 m), ambos a menos de 10 minutos a pé, em um dos melhores pontos da Zona Sul.\n\nDestaque do imóvel\nVaranda gourmet completa com churrasqueira a carvão, choppeira, fechamento em vidro, vista livre para árvores da Av. dos Bandeirantes, sol da manhã e um pôr do sol incrível — ideal para receber amigos e relaxar.\n\nCaracterísticas do apartamento\n• 3 dormitórios, sendo 1 suíte\n• Terceiro dormitório transformado em closet + escritório (reversível)\n• Banheiro social\n• Cozinha americana integrada à sala\n• Área de serviço separada com portas de vidro\n• Piso em porcelanato\n• Bancadas em granito de alta qualidade\n• Móveis planejados de alto padrão\n• 1 vaga coberta\n• Condomínio com menos de 10 anos\n\nLazer completo!\n \nValor: R$ 700.000\n\nCondomínio: R$ 1.200 | IPTU: R$ 200\n\nRef:6585jos', 'false_557191780772-1453054742@g.us_ACE874DA0F0CA6F0041CD52653614F47_131056648851558@lid', 'recebido', NULL, '2026-01-06 18:57:10', '2026-01-06 18:57:10'),
(2382, NULL, 'entrada', '55719178077214530547', 'texto', '🏡 Apartamento no Imbuí – Moradas do Bosque\n💰 R$ 470.000 | Venda\n📑 Condomínio: R$ 550/mês\n  IPTU: R$ 900\n\n📐 94 m² privativos | Andar alto\nVista livre e definitiva para a praça principal do Imbuí, excelente ventilação e privacidade.\n\nApartamento:\n• 3 quartos (1 suíte)\n• Dependência completa (reversível p/ 4º quarto ou escritório)\n• Sala ampla para estar e jantar\n• Banheiro social\n• Cozinha espaçosa\n• Área de serviço separada\n• 1 vaga de garagem\n• Totalmente nascente\n\nCondomínio Moradas do Bosque:\n• Portaria 24h | Elevadores\n• Academia ao ar livre\n• Salão de festas\n• Campo de futebol\n• Playground e parque infantil\n• Espaço gourmet com churrasqueira\n• Mercado express 24h\n\n📍 Imbuí – localização privilegiada\n\nRef:gab5239', 'false_557191780772-1453054742@g.us_AC1E7D4100271C2E1B3A12A2B9EF4BAC_131056648851558@lid', 'recebido', NULL, '2026-01-06 18:57:11', '2026-01-06 18:57:11'),
