(2570, NULL, 'entrada', '', 'texto', '📌 O SINDSEMP-BA convida os servidores e servidoras do Ministério Público do Estado da Bahia a acompanharem a reunião promovida pelo MPBA, que irá debater as *mudanças no modelo de financiamento do PLANSERV, estabelecidas pela Lei Estadual nº 15.034/2024*. O encontro acontece nesta *sexta-feira, 09 de janeiro, às 16h, no Salão Nobre da Sede do MPBA, no Centro Administrativo da Bahia (CAB),* com transmissão on-line pela plataforma Microsoft Teams: https://bit.ly/ReuniãoMudançasPLANSERV\n\nO sindicato participa da reunião na condição de debatedor, ao lado de representantes do PLANSERV e MPBA, com o objetivo de *esclarecer os principais pontos da mudança legislativa e seus possíveis impactos para os servidores*. A presença e o acompanhamento da categoria são fundamentais para fortalecer o diálogo e ampliar o entendimento sobre um tema que afeta especialmente a assistência à saúde dos usuários do PLANSERV. 🤝', 'false_status@broadcast_A5507C5998B9F2B8DFE506380761A9C7_557193231002@c.us', 'recebido', NULL, '2026-01-07 16:13:14', '2026-01-07 16:13:14'),
