(2572, NULL, 'entrada', '120363153211725317', 'texto', '*Repassando a Vaga - Não é minha*\n\nSELEÇÃO | GESTOR DE AUTOMAÇÕES SÊNIOR\n\nEstou abrindo processo de seleção para Gestor de Automação Sênior, para cuidar exclusivamente da infraestrutura de uma empresa.\n\nPreferência: Presencial em Alphaville\nHome office: Pode ser analisado, desde que o nível técnico seja alto\n\nNão buscamos empresa ou agência.\nBusco uma pessoa para crescer junto com o projeto, com envolvimento real na operação.\n\n⸻\n\nMissão da vaga\nCuidar de toda a infraestrutura de automações, incluindo:\n	•	API oficial\n	•	CRM\n	•	Disparos\n	•	Estrutura de funis\n	•	Estabilidade, escala e performance da operação\n\n⸻\n\nResponsabilidades\n	•	Gestão de API oficial\n	•	Estruturação e manutenção de CRM\n	•	Criação e otimização de funis automatizados\n	•	Gestão de disparos e regras\n	•	Monitoramento da infraestrutura e prevenção de falhas\n\n⸻\n\nPré-requisitos (obrigatórios)\n	•	Nível Sênior\n	•	Experiência real com API oficial\n	•	Domínio de CRM e automações\n	•	Vivência com operações de escala\n	•	Compromisso de longo prazo com o projeto\n\nNão é vaga júnior\nNão é vaga para empresas ou agências\n\n⸻\n\nProcesso de seleção\nPara se candidatar, enviar mensagem com as informações abaixo para o número:\nhttps://wa.link/euvkzu\n	1.	Ferramentas de automação e CRM que domina\n	2.	Exemplo de funil automatizado que já estruturou\n	3.	Experiência prática com API oficial\n	4.	Informar se pode atuar presencialmente em Alphaville ou em home office\n       5. Um áudio contando suas experiências profissionais e momento de vida. \n\nMensagens fora desse padrão não serão consideradas.\n\n⸻\n\nRemuneração e benefícios\n	•	Salário: R$ 10.000,00\n	•	Plano de saúde\n	•	Plano odontológico\n	•	Variável a partir do segundo mês', 'false_120363153211725317@g.us_3EB0DA5BE86E330EFF8438_193896499945644@lid', 'recebido', NULL, '2026-01-07 16:29:05', '2026-01-07 16:29:05'),
