(2720, NULL, 'entrada', '55719178077214530547', 'texto', 'APARTAMENTO 3 QUARTOS COM SUÍTE À VENDA – MORRO DO GATO\n\nExcelente apartamento com 104 m², composto por três quartos, sendo uma suíte, vista mar e dependência completa.\nO imóvel é finamente decorado e totalmente reformado, localizado na melhor área do charmoso bairro Morro do Gato, no Jardim Apipema.\n\nDestaques do imóvel:\n	•	104 m² muito bem distribuídos\n	•	3 quartos (1 suíte)\n	•	Vista mar\n	•	Dependência completa\n	•	Acabamentos de alto padrão\n	•	Localização privilegiada no Morro do gato com vista para o circuito do carnaval e para o mar\n\nValor: R$ 1.200.000,00\nCondomínio: R$ 1.886,00\nIPTU: R$ 3.715,00 (anual)\n\nAgende sua visita e surpreenda-se!', 'false_557191780772-1453054742@g.us_2A254353AB0D72E0A778_9728268710061@lid', 'recebido', NULL, '2026-01-08 13:51:49', '2026-01-08 13:51:49'),
