(2723, NULL, 'entrada', '55719178077214530547', 'texto', '✨ APARTAMENTO 3 QUARTOS À VENDA EM BROTAS – OPORTUNIDADE IMPERDÍVEL! ✨\n\nSe você busca conforto, praticidade e uma localização privilegiada, este é o imóvel ideal!\nLocalizado na Dom João VI, coração de Brotas, este amplo apartamento de 88m², nascente, oferece ambientes bem distribuídos e excelente ventilação.\n\n🏡 Destaques do imóvel:\n• 3 quartos amplos\n• 88 m² bem aproveitados\n• Nascente – super ventilado e iluminado\n• Prédio de escada\n• Localização excepcional – acesso rápido a tudo que Brotas oferece\n• Sem garagem (mas com fácil acesso a transporte, comércios e serviços)\n\n💰 Preço super atrativo:\nValor: R$ 260.000\nCondomínio: R$ 260,00\n\n📞 Agende sua visita e garanta essa oportunidade!\n\n⸻\n\nHashtags:\n#ApartamentoAVendaEmBrotas #Brotas #DomJoãoVI #Oportunidade #ImóvelEmSalvador #3Quartos #ApartamentoAVenda #VendaDeImóvel #SalvadorBA #ImóveisSalvador', 'false_557191780772-1453054742@g.us_2A48AE05BD3B3D245008_9728268710061@lid', 'recebido', NULL, '2026-01-08 14:10:21', '2026-01-08 14:10:21'),
(2724, NULL, 'entrada', '120363153211725317', 'texto', 'Só pra lembrar a galera:\n\nFalha crítica no n8n expõe cerca de 100 mil servidores a ataques de execução remota de código: a vulnerabilidade CVE-2026-21858 (“ni8mare”) garante acesso às máquinas sem necessidade de qualquer tipo de autenticação. O problema está relacionado à forma como o serviço processa webhooks, possibilitando que um invasor consiga manipular cabeçalhos HTTP para sobrescrever variáveis internas da aplicação e, assim, tornar possível a leitura de arquivos arbitrários do sistema. A correção está disponível a partir da versão 1.121.0. As informações são do site The Register', 'false_120363153211725317@g.us_ACE9DAD18B85063709E88A24F4305A00_235098070876234@lid', 'recebido', NULL, '2026-01-08 14:23:15', '2026-01-08 14:23:15'),
