(2814, NULL, 'entrada', '120363153211725317', 'texto', 'Telera eh chip virtual cm mensalidade', 'false_120363153211725317@g.us_3A49FEC99E6D99E4D7AA_193896499945644@lid', 'recebido', NULL, '2026-01-09 01:12:49', '2026-01-09 01:12:49'),
(2815, NULL, 'entrada', '120363153211725317', 'texto', 'Tem que ser número virtual. Mas pode cair, sumir, dar problema a qualquer momento. Tenha isso em mente.', 'false_120363153211725317@g.us_AC5F6E7E5A3B478CA319CCE60454D5FF_235098070876234@lid', 'recebido', NULL, '2026-01-09 01:13:56', '2026-01-09 01:13:56'),
(2816, NULL, 'entrada', '120363153211725317', 'texto', 'Então não tem como fugir, comprar chip e colocar na operadora, é isso?', 'false_120363153211725317@g.us_2A291C0C9095378C8B4B_37542426607742@lid', 'recebido', NULL, '2026-01-09 02:36:41', '2026-01-09 02:36:41'),
(2817, NULL, 'entrada', '120363153211725317', 'texto', 'pode comprar o Telera. funcioa tudo igual.\n\nsms, ligação, zap..', 'false_120363153211725317@g.us_3EB0C3E6CDD011E7D46DE3_193896499945644@lid', 'recebido', NULL, '2026-01-09 03:25:20', '2026-01-09 03:25:20'),
(2818, NULL, 'entrada', '120363153211725317', 'texto', 'Depende do tipo de automação e se vai usar API oficial ou não.\n\nSe não for usar oficial, virtual vai te dar prejuízo, pois quando a Meta derrubar o número (e VAI acontecer), não tem como pedir revisao pois não terá SMS para reconectar.\n\nA Meta tá derrubando números meus que nunca começaram conversas e que nunca fizeram disparo, só atendimento. Porém, com recisão em menos de 24 horas volta.', 'false_120363153211725317@g.us_AC20BA728BC63DFB0F5C9590C7D6D92F_196722538094652@lid', 'recebido', NULL, '2026-01-09 03:29:47', '2026-01-09 03:29:47'),
(2819, NULL, 'entrada', '120363153211725317', 'texto', 'Completando....\n\no problema não é ser virtual, o problema é ser Descartavel.\n\no telera nao é descrtavel, é uma linha que usa como tel normal. \n\nuso há meses', 'false_120363153211725317@g.us_3EB04E36F27A313C906AE6_193896499945644@lid', 'recebido', NULL, '2026-01-09 03:46:53', '2026-01-09 03:46:53'),
