(2881, NULL, 'entrada', '55719178077214530547', 'texto', '*🟢INACREDITAVÉL* Apartamento, Imbui. 3/4 com suíte, varanda gourmet, reformado\nValor R$ 579.000\n\nCondomínio R$ 640 \nIPTU R$ 212\n\nAlto padrão de acabamento, living, varanda gourmet, WC social, área e WC de serviço.\nEmpreendimento conta com parque infantil, brinquedoteca, piscina com raia, churrasqueira, academia de ginástica, sauna a vapor com ducha, sala de repouso, salão de jogos e salão de festas com espaço gourmet.\n03 quartos sendo uma suíte (quarto do casal com closet, 89,52m2 de área privativa, uma vaga de garagem, porcelanato em todos os ambientes, dispensa, área de serviço, ar-condicionado em todos os quartos e também na sala, armários planejado em todos os cômodos e varanda gourmet com fechamento em reiki.\n\n\nRef:FS2101', 'false_557191780772-1453054742@g.us_ACBB190AD21DB8CA30A8418A7DCF91C4_131056648851558@lid', 'recebido', NULL, '2026-01-09 16:18:00', '2026-01-09 16:18:00'),
