(3205, NULL, 'entrada', '', 'texto', '✨ O SINDSEMP-BA convida todos os servidores e servidoras do Ministério Público do Estado da Bahia para participarem da *Noite do Ministério Público do Estado da Bahia*, evento integrante da *Novena do Santuário do Nosso Senhor do Bonfim da Bahia*. A celebração ocorrerá nesta segunda-feira, *12 de janeiro de 2026, às 19h, na Basílica Santuário Senhor do Bonfim*, situada na Praça Senhor do Bonfim, nº 50, em Salvador. Trata-se de um momento relevante para a instituição que todos nós integramos, dialogando com tradições, valores e símbolos presentes na cultura baiana.\n\nMais do que um ato religioso, a Noite do Ministério Público representa uma oportunidade para reafirmarmos o sentimento de *pertencimento e unidade* entre Todos os que constroem diariamente o MPBA. \n\nIndependentemente de crença ou prática individual, o SINDSEMP-BA entende que este é um convite que contempla a todos nós, fortalecendo vínculos humanos e institucionais. Esperamos contar com a presença da categoria e desejamos que este momento seja vivido como expressão de respeito, acolhimento e identidade coletiva. 💫', 'false_status@broadcast_A56D4055C3E5877582331E0A100EF1E9_557193231002@c.us', 'recebido', NULL, '2026-01-11 20:59:11', '2026-01-11 20:59:11'),
