(3278, NULL, 'entrada', '120363153211725317', 'texto', 'Mas só para deixar claro, não é que sou contra o Elementor. Eu tenho sites com Elementor que estão funcionando, então não vou mexer, rsrs.\n\nSó estou dizendo que ele não é a única solução e nem de longe a melhor.', 'false_120363153211725317@g.us_AC8E423CEFBFEC378D99B2736929007B_196722538094652@lid', 'recebido', NULL, '2026-01-12 14:59:38', '2026-01-12 14:59:38'),
