(3375, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *Imbui* \nApartamento · 54m² · 2 quartos · 1 vaga\n\nvenda R$ 465.000\nCondomínio R$ 617 · IPTU R$ 187\n\nRua Jayme Sapolnik \n10 anos de construído \nPreço reduzido! \n2/4 com suíte e planejados no Imbuí\nApartamento  andar alto, bem ventilado, iluminado.\n2 quartos (sendo 1 suíte)\nSala ampla para dois ambientes\nCozinha funcional\n2 banheiros\n1 vaga de garagem coberta\nDiferenciais:\nO imóvel conta com (INCLUSO) armários planejados na cozinha, nos banheiros e na suíte, painel de TV na sala, forno, cooktop, lava-louças e ventiladores de teto!\nAmbiente moderno, prático e muito bem cuidado.\n\nCondomínio completo \nPiscina adulto e infantil\nAcademia equipada\nSalão de festas e salão de jogos\nQuadra poliesportiva\nParque infantil\nEspaço gourmet e quiosque com churrasqueira\nPortaria 24h e segurança completa\n\nLocalização privilegiada\n\nPróximo à Praça do Imbuí (área verde, food trucks e lazer)\n\n Ref,;tha6737', 'false_557191780772-1453054742@g.us_AC0235B76B6526E01C321A90CA3AA016_131056648851558@lid', 'recebido', NULL, '2026-01-12 21:41:47', '2026-01-12 21:41:47'),
