(3377, NULL, 'entrada', '55719178077214530547', 'texto', '🟢 *Itaigara* \nCobertura exclusiva no Alto Itaigara, em Salvador,totalmente reformado, com padrão das melhores coberturas de São Paulo e planta inspirada nas coberturas americanas de Nova York.\n\nApartamento · 270m² · 3 quartos (1 suíte master com closet) · dependência · 3 vagas soltas\nVenda: R$ 1.733.000\nCondomínio: R$ 2.900 · IPTU: R$ 850\n\nDestaques: vista panorâmica .\n1º andar (dia-a-dia): 3/4 (1 suíte master com closet), cozinha principal, dependência, e sala ampla de recepção.\n2º andar (festas e lazer): espaço aberto que pode ser transformado em salão para 50 pessoas, 2ª cozinha independente com ilha americana, e sala principal com grandes janelas e vista permanente da cidade.\n\nRooftop integrado dentro do apartamento: lareira ao ar livre, cinema ao céu aberto, piscina, jardim no rooftop – ambiente amplo e exclusivo de lazer privativo.\nCondomínio completo com lazer: academia ampla com 30+ equipamentos, piscina aquecida interna, piscina externa, brinquedoteca, salão de festas, quadras e outros itens de lazer. \n\nRef;ped4944', 'false_557191780772-1453054742@g.us_AC5798FD143D0B1F73D30740CA0750BF_131056648851558@lid', 'recebido', NULL, '2026-01-12 21:41:48', '2026-01-12 21:41:48'),
