(3441, NULL, 'entrada', '120363405505672490', 'texto', '2️⃣ *Hoje às 19h30* vai rolar a _Aula 2_!\n\n👏🏻 Queria dar os _parabéns_ para todo mundo que participou do ao vivo de ontem! A primeira aula da Jornada Python foi um _verdadeiro sucesso_! \n\n🎉 E tenho uma boa notícia: _independente se você não esteve lá ontem_, hoje vai rolar a segunda aula e nela você vai aprender a criar *projetos de Análise de Dados* de forma _rápida_ e _eficiente_ utilizando o Python.\n\n📜 _Lembrando_ que você vai poder _ao vivo validar a sua presença_ nessa aula para ter o *Certificado de Participação* ao final da Jornada.\n\n⬇️ Já vou deixar aqui o _link da Aula 2_ de mais tarde pra facilitar.\nhttp://eventoshashtag.herokuapp.com/youtube/v/0c2AfijcWb0\n\n🔔 Aproveita, entra no link acima e clica em \"Receber notificações\" para ser notificado _na hora que começar_!\n\n🔈E caso você tenha _perdido a Aula 1_ e quiser assistir ainda, é só clicar nesse link aqui:\nhttp://eventoshashtag.herokuapp.com/youtube/v/0GDt-6H9NWM\n\n🤓 Nos vemos mais tarde, _às 19h30min_ (horário de Brasília)!', 'false_120363405505672490@g.us_3EB0648184EE311585C7D4CE257F0A423223F8F8_149332271591631@lid', 'recebido', NULL, '2026-01-13 12:00:16', '2026-01-13 12:00:16'),
