(3571, NULL, 'entrada', '', 'texto', '📌 O SINDSEMP-BA realizou, na manhã desta terça-feira (13), a 28a. reunião Ordinária da Diretoria Executiva, dando início às agendas de trabalho de 2026 e retomando pautas pendentes do exercício anterior. O encontro marcou o alinhamento das primeiras ações estratégicas previstas para o período.\n\n“Este é um momento fundamental de organização interna, para garantir que as demandas da categoria sejam acompanhadas desde o início do ano”, destacou a Diretora-Presidente, Erica Oliveira. Entre as pautas definidas como prioritárias para 2026 estão a venda da licença-prêmio e a SaúdeMental, este último que envolve questões como reajuste do auxílio-saúde, a Jornada Positiva e teletrabalho. ✍️\n\n📲 Saiba mais, acesse: https://sindsempba.org.br/sindsemp-ba-abre-agenda-de-2026-com-reunioes-debates-sobre-saude-e-participacao-institucional/', 'false_status@broadcast_A5F1738FFA30C7341AC44B9C48589522_557193231002@c.us', 'recebido', NULL, '2026-01-13 22:11:05', '2026-01-13 22:11:05'),
