(3661, NULL, 'entrada', '120363153211725317', 'texto', '*Falha grave no NodeJS permite ataques de negação de serviço*\n\nO problema ocorre quando o recurso “async_hooks” está ativo e o código provoca um stack overflow, em que chamadas recursivas ou estruturas excessivamente profundas ultrapassam o limite da pilha de execução. Nesse cenário, o processo do NodeJS é encerrado, o que faz o servidor parar de funcionar instantaneamente. A vulnerabilidade foi mitigada nas versões 20.20.0, 22.22.0, 24.13.0 e 25.3.0. Aplicações NextJS ou React usando o Node na versão 24 ou superior não foram afetadas.', 'false_120363153211725317@g.us_ACEF8A1B8244A0CC38668E1645CF1C7D_235098070876234@lid', 'recebido', NULL, '2026-01-14 16:08:12', '2026-01-14 16:08:12'),
