(3663, NULL, 'entrada', '120363153211725317', 'texto', '*Profissionais anônimos inseridos em grandes empresas de IA dos EUA lançam projeto conjunto que busca “envenenar” web crawlers*\n\nEsses sistemas coletam informações de sites que são posteriormente usadas no treinamento de modelos. O Poison Fountain acredita que a IA é uma ameaça à espécie humana e propõe que administradores adicionem links específicos em suas páginas para fornecer dados incorretos à tecnologia, incluindo código propositalmente errado, com falhas lógicas.', 'false_120363153211725317@g.us_ACA038D1FE30D24EC9021F659F90F0D3_235098070876234@lid', 'recebido', NULL, '2026-01-14 16:10:35', '2026-01-14 16:10:35'),
