(3767, NULL, 'entrada', '120363405505672490', 'texto', '🫵 Quer aprender Python com *até R$500 de desconto*?\n\n🏁 Ontem eu _abri as inscrições_ para o *Progama Completo Python Impressionador*. \n\n🔥 Onde você vai aprender desde _o nível zero até o avançado_, *tudo o que você precisa saber de Python para se destacar* em qualquer empresa. Ou até para _vender seus próprios projetos_.\n\n👀 Só que _muuuitas pessoas_ pediram para gente estender a oportunidade para hoje...\n\n🎉 Então eu tenho _boas notícias_! Para você, que está _inscrito na Jornada Python_ e fizer a sua *inscrição hoje*, vai ganhar *até R$500 de desconto* e *bônus super especiais*! \n\n⬇️ Para entender exatamente _como funciona_ o Programa e os bônus especiais, basta acessar esse _link aqui_:\nhttps://eventoshashtag.herokuapp.com/redirect/lpy-gw\n\n🚀 E aproveito para te lembrar os diferencias que só existem no Python Impressionador: Integrações do Mercado de Trabalho +  9 Projetos Reais e Completos nas principais áreas de aplicação do Python + Plantão de Dúvidas.\n\n😱 Além disso, sem *nenhum custo adicional*, você vai ter acesso a nossa _Comunidade Impressionadora_! Pacote com *nossos Cursos Completos e Impressionadores*, que vão te ajudar a evoluir cada vez mais nas linguagens e tecnologias _mais usadas nas empresas_. Como o Agentes de IA, N8N, SQL, Power BI e muito mais!\n\n⏰ PS: *Hoje às 19h30min* (horário de Brasília), vai rolar ao vivo a *última aula* da Jornada Python! Mais próximo do horário da aula vou te enviar por aqui o link da live.', 'false_120363405505672490@g.us_3EB0A56D5C919E0F108F18E1D5D62C5C20D42E60_149332271591631@lid', 'recebido', NULL, '2026-01-15 12:01:34', '2026-01-15 12:01:34'),
