(3779, NULL, 'entrada', '120363175746047388', 'texto', 'Pessoal, tudo bem? Uma dica rápida que fiz com um cliente que ficou bem legal e natural. Para quem usa algum robô de notícias, onde utilizam fontes.\n\nAo invés de criar as imagens do 0, que dependendo ficam sem contexto, fiz um esquema usando a API do serper.dev (pode ser outra que busca na internet). \n\nEu uso o título e faço uma busca na internet só de imagens relacionadas. Depois separo as 3 primeiras. Daí no Nano Banana Pro, no modo edição, peço a ele para criar uma imagem unica usando as 3 imagens. Daí no prompt você pode fazer mais, tipo para tirar logos, frases e etc.\n\nAs imagens estão saindo super realistas (pois usa elementos das originais) e totalmente única. Para notícias, particularmente foi a melhor solução até agora.', 'false_120363175746047388@g.us_AC66A60D0C03FBFCB6BA6B409F14022A_196722538094652@lid', 'recebido', NULL, '2026-01-15 13:54:30', '2026-01-15 13:54:30'),
