(3897, NULL, 'entrada', '120363049065419885', 'texto', 'na faculdade, ensinavam esse mar de rosas, que quem sabe é nos e não o cliente, e e eu passei muitos meses ou até anos batendo na tecla brigando com o cliente e sempre tendo mais dor de cabeça do que dinheiro no bolso...\n\nAi até que aprendir que o cliente sempre tem razão, e pronto, entregava os design, sites etc, sendo uma MERDA, coisa que nunca publiquei ou assinei, mas eu acabava ganhando dinehrio rpaido do cliente e ele contendo as vezes até pagavam a mais, e sempre indicavam pra vários clientes, \n\ntanto que hj tenho uma carteira boa de clientes de freelas, e uma network muita boa entre eles, faz anos que n sei oq é fazer um patrocinado ou campanha ou até mesmo me divulgar...\n\nsempre eles traziam clientes /amigos/familiares/desconhecidos da rua pra fechar cmg, \n\naté que eu depois de ta com as coisas estáveis com uns contratos aqui, outro ali, comecei a recusar cliente e comecei aumentar meus preços a cada novo orçamenot, até chegar num valor legal, e hj to ai, de boa...\n\nAté hj mesmo que o cliente me pague pra eu fazer tudo do zero, ele ainda tem decisaõ final, \nas vezes o mesmo cliente que costuma me pagar 1k, 2k, ou até 5k, as veszes fecho por menos de 50% do valor original so pra fechar mais um freela e nem ter dor de cabeça com cliente,  se é que me entende... \n\nAi quando n quero fechar com ninguem ai nem bato cabeça so flo que to com agenda cheia, e se quierem algo de urgencia, ai paga o triplo do valor,(20% fecha nos triplo), pq recorrerem o barato e depois voltam pra fazer.. ai ja eduquei alguns que se forem no barato vaõ ter tor de cabeça\nmas n são todos, são alguns, graças a Deus não dependo mais de freelas, mas pego de vez enquando..', 'false_120363049065419885@g.us_3EB0765CAB375D218C6026_94291762380893@lid', 'recebido', NULL, '2026-01-15 21:52:25', '2026-01-15 21:52:25'),
