(3936, NULL, 'entrada', '120363405505672490', 'texto', 'A Jornada acabou, _mas você não precisa ficar de fora_!\n\n👏🏽 Já tivemos _mais de 285 mil visualizações nas aulas_ da Jornada Python. E se você participou, fica aqui meus parabéns pela sua dedicação.\n\n📽️ Caso você não tenha conseguido assistir alguma aula, aproveita que elas *vão ficar no ar até às 23h59 de domingo*, dia 18/01.\n\n🎯 E eu sei que alguns de vocês _vão querer ir além_ e *aprender tudo o que precisa de Python para* ser mais valorizado e se tornar uma referência. Foi exatamente por isso que eu criei o *Programa Completo Python Impressionador*. \n\n⬇️ Para _saber mais_ sobre o Programa e garantir a sua vaga, é só _clicar nesse link aqui_:\nhttps://eventoshashtag.herokuapp.com/redirect/lpy-gw\n\n🦾 Inclusive, para essa turma eu decidi dar _acesso a outros programas impressionadores da Hashtag_, como o Agentes de IA, n8n, Análise de Dados, Power BI, SQL e muito mais! \n\n💥 São programas realmente completos, do básico ao avançado, com _material_, apostila, _suporte a dúvidas_ e tudo mais, que você vai ter acesso sem nenhum custo adicional, assim que fizer a sua inscrição.\n\n🤑 A melhor parte é que _quem entrar hoje_ nessa turma, vai ganhar *até R$500 de desconto* e *outros bônus especiais*.\n\n⚠️ Mas _cuidado_: isso só vale para _essa turma_ da Jornada e vai durar _pouquíssimo tempo_ (mesmo), então não deixe para depois.', 'false_120363405505672490@g.us_3EB029227A3F1B553E1B57D84987739926FAEE0D_149332271591631@lid', 'recebido', NULL, '2026-01-16 12:01:34', '2026-01-16 12:01:34'),
