(4027, NULL, 'entrada', '', 'texto', 'Atenção, servidores e servidoras do MPBA!\n📢 Notícia urgente! Aproveite a condição especial!\n\nOs interessados em aderir ao Plano de Saúde Seguros Unimed, conveniado ao SINDSEMP-BA, com CARÊNCIA ZERO, têm até o dia *19 de janeiro* para enviar toda a documentação necessária.\nA vigência do plano passa a valer a partir de fevereiro deste ano.\n\n⚠️ Importante: a carência zero não se aplica a parto e doenças preexistentes.\n\nDocumentação para adesão:\n\n👤 Titular\n• RG/CPF ou CNH\n• Comprovante de residência\n• Formulário de adesão preenchido\n• Autorização de desconto em folha preenchido\n• Contracheque\n• Declaração de filiação\n\n👥 Dependentes\n• RG/CPF ou CNH\n• Certidão de nascimento (para menores sem RG)\n• Certidão de casamento ou união estável (cônjuge)\n\n📌 Tabela de valores e lista completa de documentos no card abaixo.\n\nPara maiores informações:\n📞 Paulo Rangel – Consultor (KAJAMA): (71) 99921-1717\n📞 Lourival Alves – Diretor Administrativo (SINDSEMP-BA): (71) 99377-1005', 'false_status@broadcast_A551A9E68CD3E1459BDD5DE3DC72F705_557193231002@c.us', 'recebido', NULL, '2026-01-16 18:58:07', '2026-01-16 18:58:07'),
