(4040, NULL, 'entrada', '', 'texto', '📌 O SINDSEMP-BA convoca os servidores filiados para participarem de uma Assembleia Geral Extraordinária Virtual na próxima quarta-feira, 21 de janeiro. O encontro, que será realizado via Microsoft Teams (https://bit.ly/AGEV-01-2026-SINDSEMP-BA), tem como objetivo discutir a proposta de reforma do Estatuto da entidade.\n\nDe acordo com o edital, a assembleia tem início às 14h e deve seguir até as 18h. O debate vai ocorrer entre 14h e 17h, com mediação da Diretoria Executiva e da Comissão da Reforma. Caso haja necessidade de deliberação por voto, o processo será aberto das 17h às 18h, por meio do Sindsystem, aplicativo oficial do sindicato. ✍️\n\n📲 Saiba mais, acesse: https://sindsempba.org.br/sindsemp-ba-convoca-assembleia-geral-virtual-para-discutir-reforma-do-estatuto/', 'false_status@broadcast_A57B136EDFCCAD632B20D603D8ED7078_557193231002@c.us', 'recebido', NULL, '2026-01-16 19:21:35', '2026-01-16 19:21:35'),
